description:
The Lion King:  Disney's epic coming-of-age saga tells of the love between a proud lion ruler, Mufasa and his son Simba - a naive and curious cub who &quot;just can't wait to be king.&quot; But Simba's envious Uncle Scar has other plans, and his scheming for the throne leads to Simba's exile from the kingdom he should rightfully rule. Befriended by the hilarious warthog, Pumbaa and his manic meerkat companion, Timon, Simba forgets his regal responsibilities and adopts a carefree lifestyle of &quot;Hakuna Matata.&quot;

The Lion King 2: Simba's Pride Kiara, Simba's playfully headstrong daughter and heir to the Pride Lands, is on the prowl for adventure. Escaping her bumbling baby-sitters Timon and Pumbaa, Kiara runs off to the Outlands, which are strictly off limits. There she meets the mischievous Kovu - a young cub chosen to walk in Scar's paw prints. The rift between the Outlanders and Simba's pride deepens as Kiara and Kovu's feeling for each other grow. But will love find a way to bring their very different worlds together as one?

The Lion King 3: Hakuna Matata Timon the meerkat and Pumbaa the warthog retell the story of The Lion King from their own unique perspective!
